import React, { useState } from 'react';
import { IonHeader, 
    IonToolbar, 
    IonButtons, 
    IonButton, 
    IonTitle, 
    IonIcon, 
    IonMenu, 
    IonContent, 
    IonItem, 
    IonList, 
    IonLabel} from '@ionic/react';
import '../css/Menu.css';
import '../css/Global.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faPaperPlane } from '@fortawesome/free-regular-svg-icons'
import { faHome } from '@fortawesome/free-solid-svg-icons'

const Menu: React.FC = props => {

    return(
        <IonMenu side="end" contentId="menuContent" menuId="first" id="menu">
            <IonContent id="menuContent" class="menuContent">
                <IonList class="menuList">
                    <IonItem class="menuItem" lines="none">
                        <FontAwesomeIcon id="menuIcon" size="lg" icon={faHome} />
                        <IonLabel style={{background: "white"}}>Home</IonLabel>
                    </IonItem>
                    <IonItem class="menuItem" lines="none">
                        <IonLabel>Open House Programmes</IonLabel>
                    </IonItem>
                </IonList>
            </IonContent>
        </IonMenu>
    );
}

export default Menu;
